<div class="count left copies">

<script>
    function rand(min, max) {
        return Math.floor(Math.random() * (max - min + 1)) + min;
    }

    var c = rand(101, 110);
    $("#copies").html(c);

    function copies() {
        var el = $("#copies");
        var left = parseInt($(el).html());
        left = left < 250 ? left + rand(-1, 3) : left - rand(1, 3);
        $(el).html(left);
        setTimeout('copies()', rand(6000, 9000));
    }

    $(function () {
        copies();
    });
</script>
